import React from "react";

function App() {
  const src = "https://media.w3.org/2010/05/sintel/trailer_hd.mp4 ";
  return (
    <div>
      <video width="100%" src={src} type="video/mp4" preload="auto" />
    </div>
  );
}

export default App;
